"announcement": "Each piece of Cornish Hill Pottery is hand thown and decorated by me, Gogi Millner. \r\nAnything listed on ETSY is in stock and ready to ship,  usually in 1-2 business days.\r\nIf you are local to Wolfeboro, NH please call or email for a listing without shipping fees.\r\n\r\nCornish Hill Pottery is located in the village of Wolfeboro, New Hampshire, on the shores of Lake Winnipesaukee.\r\n\r\nI make hand crafted functional stoneware, decorated in the traditions of Early American and European potters with a method known as &#39;slip trailing&#39;. The slip is a creamy mixture of clay and water which is applied to moist or &#39;leather hard&#39; pots by brush and by extrusion through a fine nozzle on a hand held squeeze bottle. The slips contain various colorants, including natural clay colors and metals such as cobalt.\r\n\r\nThe pots are bisque fired to remove the chemically combined water and to oxidize organic impurities. Then the pots are glazed and glaze trail decorated. Next follows a firing to approximately 2200 °F in which the glaze is melted to a glass and the clay body becomes vitrified.\r\n\r\nThe pottery is oven, microwave, and dishwasher safe. As with any ceramic piece, take care to avoid extreme and abrupt temperature changes. I use no lead or other harmful glaze materials.\r\n\r\nShipping: Shipping prices are to continental US only. All items will be shipped within a week of purchase, usually the next business day.  I will ship worldwide but need to quote each purchase individually.  Usually USPostal is cheaper.\r\n\r\nInventory: If you are looking for more than one piece , or if you would like to place a special order, please contact me!  Quantity discounts are available and negotiable.\r\n\r\nAlso, Visit the Cornish Hill Pottery website at\r\n www.cornishhillpottery.com\r\n\r\n The Cornish Hill Pottery Facebook Page: \r\nhttp://www.facebook.com/pages/Cornish-Hill-Pottery/116984011660304?ref=ts",
