"description": "Personalized Child&#39;s Birth Plate -Baby Gift New Baby - Lamb or Sheep Design\r\n\r\nCHILDREN’S PLATES \r\nNow in my 35th year of making Cornish Hill Pottery, I am in the amazing position of going into a 2nd generation of Baby Plates! While usually ordered for a new baby, I have made these for bar/bat mitvahs, weddings, reunions, and graduations.\r\n\r\nThese 7” plates started out with one design... blue bunny on stoneware. Now there are three  “most popular” designs: \r\nbunny (still #1) \r\nteddy bear, and \r\nrocking horse. \r\n\r\nIn addition I make a\r\nlamb, \r\nkitty, \r\npuppy, \r\nsailboat,\r\n flowers, \r\nand a few other special requests. \r\nGenerally I can fit the entire child’s name and spell out the Month of the birthdate.\r\n\r\nEach plate is hand thrown and then decorated free hand with blue clay slip.  \r\nEach as unique as the child it is being made for.\r\n\r\n Personalized Items are always made to order \r\nIt usually takes between 4-6 weeks to complete an order.\r\n\r\nPlease enter the details of your plate in the message to seller window when you check out, including:\r\nnames: \r\ndate of birth:\r\nand design:\r\n\r\nThe plate will be delivered in a glossy white gift box. If you wish to have me ship directly to the recipients, I am happy to enclose a card with whatever message you like.\r\n\r\nBy request, a gift notice can be sent in advance of this commissioned gift. (to you or the recipient)",
