"title": "Barbaro In Heaven... DIGITAL DOWNLOAD... ~Counted~ Cross Stitch Pattern ~Computer Generated~ Thoroughbred Horses BBXS",
"description": "PLEASE READ THE ENTIRE PAGE CAREFULLY BEFORE YOU BUY!\r\n\r\n*INSTANT DIGITAL DOWNLOAD* available for you as soon as payment is made... for CUSTOMER to print. ***NO PHYSICAL ITEM WILL BE SHIPPED.***\r\n\r\nI use to sell on E Bay... user name MAC-CAW... store name... THEBEADEDBIRD... & you can see my feedback rating at this link...\r\nhttp://feedback.ebay.com/ws/eBayISAPI.dll?ViewFeedback2&userid=mac-caw\r\n\r\nThese are COMPUTER~GENERATED, DIGITAL, ~COUNTED~ cross stitch PATTERNS ONLY.  They are not kits.  You supply your own fabric and floss.\r\n\r\nWITH YOUR PURCHASE YOU WILL RECEIVE...\r\n1. Color picture of the original photograph.\r\n2. A 12 page Black & White Pattern chart with Symbols.\r\n3. A 12 page Color Pattern chart with Symbols.\r\n4. A very helpful ~TIPS~ section.\r\n5. A floss usage amount summary. \r\n6. And a floss chart for DMC, Anchor and JP Coats & Clark, so you can choose your brand of floss.\r\n\r\nThe stitch count is 216 X 163 ... & The finished picture size is 12&quot; W x 9.06&quot; H. when stitched on 18 Count Aida cloth.  But the pattern can be used for any size fabric, 12, 14, 16, 18, 20... etc.  The larger the number count, the smaller the finished piece will be.  The smaller the number count, the larger the finished piece will be.\r\n\r\nThe patterns are quite easy to understand but are recommended for people who already know how to do counted cross stitching. \r\n\r\nNo more squinting trying to read &#39;TINY&#39; symbols.  Easier to read than older, store bought patterns... & loads of fun to stitch!\r\n\r\nThe stitching chart is set ***FOR YOU TO PRINT***... at 8 squares per inch.  All stitches are full Stitches.  No half stitches & no back stitching.\r\n\r\nMy patterns are computer-generated using professional software, designed in the &#39;POINTILLIST&#39; style of art which means that when viewed from several feet away all the colors blend together making the stitched piece look realistic...like the original photo or painting from which it was created.  The amount of colors used allows subtle color changes to create this realistic look. Without it they wouldn&#39;t look anywhere NEAR as good.\r\n\r\nThe second picture is a Virtual image of the STITCHED pattern... (Minus grid lines that mute the colors, of course.)  :D\r\n\r\nThe third picture is Examples of the stitching chart in both B&W & Color... & the Floss Legend, w/symbols for DMC, Anchor and JP Coats & Clark... so you have a choice of floss brands.\r\n\r\nNo returns or refunds due to the nature of this particular item. \r\n***We will not refund money due to the ad *NOT* being read entirely or correctly.***\r\n\r\nDISCLAIMER...\r\nDue to the limitations & inconsistencies of various display monitors, the colors you see on your screen may not be a totally accurate reproduction of the actual product. Screen images are intended as a guide only and should not be regarded as absolutely correct. \r\n\r\nThis chart has been designed and printed with our best intentions of being without mistakes. However, the possibility of human error, printing mistakes or the variation of individual stitching does exist, and we regret that we cannot be responsible for this.\r\n\r\nThese are electronic PDF files that you have to print out yourself.",
