"vacation_message": "Dear customers!\r\nAll of my listings at this time are deactivated due to lack of time to receive and fulfill new orders.   I will be getting new orders as soon as I am done fulfilling the existing ones. I am very sorry for the inconvenience  The orders that I have received by today will be fulfilled and shipped within the time frame agreed upon or stated in the description of an item.  I will be happy to fulfill orders that have been previously discussed and will happily reply to all e-mails.   At this moment  the wait time for being able to receive new orders is about 14 days.  (until  August 2) \r\nThank you and look forward to working with you soon!:-)\r\nOlga",
"sale_message": "Thank you for ordering from my store! :-)\r\nPLEASE, MAKE SURE THE ADDRESS ON YOUR ETSY ACCOUNT IS CORRECT!!  IT WILL ELIMINATE DELAYS AND NON DELIVERY. \r\nIn case you noticed that the shipping address on your account is not correct, please, contact me right away. \r\nPLEASE NOTE, THAT ALL OF MY ITEMS ARE MADE TO ORDER AND TAKE TIME TO MAKE.  The amount of time it takes to create them is different for each item and is written in the description of an item just below the photos. It may take anytime from 5 days to four weeks, so please make sure you have enough time before your event. \r\nIn some instances I am able to make a decoration sooner or have it readily available, please contact me in case you need it sooner for availability. \r\nI hope you will like my decorations and I will be happy to see you in my store again. \r\n\r\nIf you have any questions or comments about your order please do not hesitate to contact me.\r\nThank you and have a great day! :-)\r\nOlga",
"digital_sale_message": null,
"last_updated_tsz": 1412563984,
"listing_active_count": 85,
"login_name": "sweetbouquet",
"accepts_custom_requests": true,
"policy_welcome": "Welcome to Sweet Bouquet!\r\nI am happily offering you my sweet decorations to celebrate special moments in your life.   All of my decorations are hand made and are edible unless it says otherwise.  Some items have stamens in them that are non edible or wires inserted for extra support.  Make sure to read a description of an item,  you will find this information there.  \r\nAll of my products are handcrafted, thus no two items may be exactly the same. Each item is given extra attention to detail. There may be subtle color and shape variations in each piece.\r\nif you have any questions that you have not found in the description, you are welcome to contact me and ask any questions you have. \r\n Since the amount of the items in my store is growing it has become difficult for me to keep all of the items in stock all of the time.  That&#39;s why I make most of the items to order. Please, check the item description to make sure if it is available right away or made to order item.  It usually takes me about 10-21 days to make and ship an item.   If you are looking for custom made decorations, please email me  with your request. As custom decorations can take more time, please allow at least 5-8 weeks for creating and delivery.\r\n\r\nThank you!",
"policy_payment": "I accept Paypal and request that customers finalise their payments within 3 days of purchase. Please feel free to contact me if there are any problems with paying for your purchase",
"policy_shipping": "PLEASE make certain your NAME and ADDRESS in your ETSY account matches your PAYPAL account! It will eliminate delays.\r\n\r\nAll posted items and sets are made to order, I start making them after I receive a payment from you.  Some items are available and can be shipped within 1-3 days after receiving the payment, you will find this information in the item description.    The time of shipment of  custom orders  is negotiated prior to payment.  Made to order items are usually shipped within 10-21 days after an order has been received. You will find the information about creating and delivery time in the description of an item.   \r\nI ship via USPS priority mail and USPS first class for small orders. \r\nIf you need, or prefer a faster shipment method, contact me to discuss it prior to payment. \r\nInternational Customers: please contact me to clarify shipping cost to your particular country, according to the size of particular shipping item.\r\nI take extra care in packing my decorations to ensure that they get to you intact but some breakage may still occur.  I include an instruction on how to repair broken decorations.   But in case the damage is too extensive to repair, contact me and I will let you know if it is refundable.  For more information on it, please  read Refunds and Exchanges paragraph.  \r\nPlease note that I do not take any responsibility for lost Mail, or Damaged Mail by the US Postal Service. In most cases I  include some extra items in your order in case damage does occur but with some items, namely large and time consuming decorations sold individually I do not include extra items . You accept any and all liability for the loss, or damage of the package.\r\n  I do provide delivery confirmation information in case you need to know where your package is.  \r\nJust contact me and I will provide the delivery confirmation number for you. \r\nThank you",
"policy_refunds": "Sorry, but I do not accept returns, since sugar items are too fragile to travel 2 ways. I take great care to ensure that the products are well represented in photos so that you can be sure that what you are getting is exactly what you ordered. \r\nAll items are secured and wrapped to prevent movement or breakage during shipping. Even though all precautions are taken there is still a chance for some breakage. In every package I include instructions for repairing small breaks.   Please consider ordering more than you need just in case. All items are non-refundable.\r\n\r\n\r\n\r\n\r\n",
"policy_additional": "Before making a special order for a particular date, please keep in mind to make it 5-8 weeks in advance if at all possible (depending on the difficulty of the order) \r\nThank you!",
"policy_seller_info": null,
