"title": "Handmade Home Decor and Stationary ",
"announcement": "Welcome to father&#39;s daughter studio!  Handmade new with a vintage feel. Have a little browse and I hope you find something that tickles your fancy. Note FREE shipping on pillow covers! Also, check out my Facebook page (and please &quot;like&quot; me) to find a secret coupon code ;-)\r\nhttps://www.facebook.com/fathersdaughterstudio\r\n*All items are made to order by one person, me, so please pay attention to expected shipping time in listings and at check out to avoid misunderstandings, thank you.\r\n*ALL of these images can be made into pillows OR cards - convo me with your request. Please convo me if you are interested in custom orders. I am open to requests within the realm of the items I offer in my shop: pillows and cards at present.\r\n*A special note about burlap fabric:  the natural color burlap varies in shades of natural, even from the same supplier, so some appear warmer and others cooler in tone.  For the burlap transfer pillows:  the large, irregular weave creates a texture to the transfer image which adds to its charming, rustic, vintage appearance and makes them more ornamental than utilitarian. The heat transfer images are fragile because of the open weave of the fabric. Treat with care. Spot cleaning is recommended. \r\n*Custom pillow cover order requests are now limited to the digitally printed images featured in this listing as the heat transfer pillows are being phased out:  https://www.etsy.com/listing/181848034/free-ship-choose-any-image-from-shop-or?ref=shop_home_feat_2\r\n*Convo me if you would like to purchase a pillow insert.  I don&#39;t keep a large stock of inserts on hand but I can get one to you within 10-15 business days.\r\n*Presently, wholesale prices can be quoted for a minimum 50 piece order for cards and 10 for pillows with or without inserts.\r\nPlease read Shop Policies before purchase.  \r\nThanks for visiting!",
"currency_code": "USD",
"is_vacation": false,
"vacation_message": "Welcome to father&#39;s daughter studio!  Shop is shut until October 1.  Thanks for stopping by and please come back! ",
"sale_message": "A warm thanks for your interest and support of hand made! \r\nShipping and handling times are noted in each listing as well as on your receipt in your Etsy purchases page.  Some are made to order and some are ready to ship. All items are hand made by me and I do my best to get your order to you promptly.  Please contact me if you have any questions or requests.\r\n*A special note about burlap fabric:  the natural color burlap varies in shades of natural, even from the same supplier, so some appear warmer and others cooler in tone.  For the burlap transfer pillows:  the large, irregular weave creates a texture to the transfer image which adds to its charming, rustic, vintage appearance and makes them more ornamental than utilitarian. The heat transfer images are fragile because of the open weave of the fabric. Treat with care. Spot cleaning is recommended. \r\nConvo me if you would like to purchase a pillow insert.  I don&#39;t keep a large stock of inserts on hand but I can get one to you within 10-15 business days.\r\nRETURN POLICY:  \r\nAll items in my shop can be returned for exchange or refund of original price paid minus tax and shipping within 30 days of purchase.  Buyer is responsible for return shipping costs. Stationary must be returned in unused condition with original envelopes.\r\nCheck out my Facebook page and look for a coupon code for your next purchase:\r\nhttps://www.facebook.com/fathersdaughterstudio",
"digital_sale_message": null,
"last_updated_tsz": 1412554461,
"listing_active_count": 138,
"login_name": "fathersdaughtrstudio",
"accepts_custom_requests": true,
"policy_welcome": "Welcome to father&#39;s daughter studio!  I am entering into my &quot;crafty&quot; phase of life and I have assembled a few things here that I hope you might like.  My sewing machine is a classic Singer 500 A Rocketeer and I am having a blast with it!",
"policy_payment": "Father&#39;s Daughter Studio only accepts PayPal.\r\n",
"policy_shipping": "I ship via USPS First Class and Priority Mail.  I can ship USPS Express or Federal Express at an increase in shipping price, of course.  Presently, USPS First Class Int&#39;l does not offer tracking.  Please note that buyers are responsible for any and all duties and customs charges that may be incurred.  \r\nMy cards are usually shipped within 1-2 business days of receipt of payment, however, please allow up to five days especially with larger orders.  Please allow 5-10 business days for pillow covers as they are made to order.  Convo me with any special requests prior to purchase.",
"policy_refunds": "Father&#39;s Daughter Studio will happily refund full purchase price, not including shipping or taxes, if item is damaged in transit or the item is just not what the buyer expected.  The item must be returned within 30 days of receipt and return postage is to be paid by buyer.",
"policy_additional": "CUSTOM ORDERS:\r\nPlease convo me if you are interested in custom orders.  I am open to requests within the realm of the items I offer in my shop:  pillows and cards at present.  I reply to all inquiries within one business day.\r\n\r\nCARE:\r\nThe pillow covers are considered ornamental and spot cleaning is recommended.  Burlap, especially, does not wash in machines well.  If washing is necessary, hand wash in cold water with mild soap and dry on flat surface. Iron around transfer image to avoid damage.\r\n\r\nINSERTS:\r\nConvo me if you would like to purchase a pillow insert.  I don&#39;t keep a large stock of inserts on hand but I can get one to you within 10-15 business days.\r\n\r\nSHIPPING:\r\nNote cards are shipped in cellophane slip(s) to protect from moisture during transit and cardboard envelopes or boxes.  Cards are shipped via USPS First Class Mail.  Pillow covers are wrapped in tissue paper and jute twine.  Item(s) can be sent with gift receipt with price removed upon request.  Complimentary gift card with any image from my shop also available to ship with pillow covers upon request.  Pillow covers are shipped via USPS Priority Mail and reach most domestic locations within 2-3 days.\r\nExpress shipping is available - please convo before purchase with your location postal code and I will reply with cost promptly.\r\n\r\nWHOLESALE:\r\nPresently, wholesale prices can be quoted for a minimum 50 piece order for cards and 10 for pillows with or without inserts.  Cards can be shipped in individual cellophane slips for resale at a nominal price.  \r\n\r\nRETURN POLICY:  \r\nAll items in my shop can be returned for exchange or refund of original price paid minus tax and shipping within 30 days of purchase.  Stationary must be returned in unused condition with their original envelopes.  Return shipping costs are the responsibility of buyer.",
"policy_seller_info": null,
"policy_updated_tsz": 1391634176,
"vacation_autoreply": "Hello!\r\nThanks for your interest in father&#39;s daughter studio!  My shop is shut until October 1 for a small sabbatical but leave me a note if you would like a notification when it is open again for business. My email is fathersdaughterstudio@gmail.com if you would like to correspond directly with me.\r\nCheers!\r\nJody\r\nfather&#39;s daughter studio",
